	;//////////////////////////////////////Art/////////////////////////////////////////////
.code
MAIN PROC FAR
	                    mov              AX,@data                 	;initializing the data segemnt
	                    mov              DS,AX
	;///////////////////////////////First Screen////////////////////////////////////

	firstScreenLoop:    
	                    mov              ax, graphicsMode         	; enter graphicsMode
	                    mov              bx, 0100h                	; BX = 81FFh
	                    int              10h

	                    mov              ah,09h
	                    lea              dx, firstScreen          	; show the first screen
	                    int              21h

	                    mov              ah,09h
	                    lea              dx, getName              	; ask for player's name
	                    int              21h

	getNameLoop:        lea              si, playerName1          	; get player's name
	                    mov              ah, 0Ah
	                    mov              dx, si
	                    int              21h

	; TODO check of the name is valid
	; mov bp, offset playerName1 + 1
	; or           [bp], 0
	; jnz            mainMenuLoop

	; mov            ah,09h
	; lea            dx, enterValidName      	; ask for a valid player's name
	; int            21h
	; jmp            getNameLoop
	;///////////////////////////////Main Menu////////////////////////////////////
	mainMenuLoop:       
	                    clearWholeScreen
	                    mov              ax, graphicsMode         	; enter graphicsMode
	                    mov              bx, 0100h                	; BX = 81FFh
	                    int              10h
	;call             background
	                    call             drawgamebtn
	                    call             drawchatbtn
	                    call             drawexitbtn
	                    call             drawArrows

	CheckInMainMenu:    
	                    mov              ah,0                     	;  ah:al = scan code: ASCII code
	                    int              16h

	                    cmp              ah, 48h                  	; up arrow
	                    jne              downArrow
	                    cmp              arrowoffsetY, arrowAtgame
	                    je               CheckInMainMenu
	                    call             eraseArrows
	                    mov              bx, arrowStep
	                    SUB              arrowoffsetY, bx
	                    call             drawArrows
	                    jmp              CheckInMainMenu

	downArrow:          cmp              ah, 50h                  	; down arrow
	                    jne              enterbtn
	                    cmp              arrowoffsetY, arrowAtExit
	                    je               CheckInMainMenu
	                    call             eraseArrows

	                    mov              bx, arrowStep
	                    ADD              arrowoffsetY, bx
	                    call             drawArrows

	                    jmp              CheckInMainMenu

	enterbtn:           cmp              ah, 01ch                 	; enter
		            	jne              CheckInMainMenu			; added to prevent other buttons from doing enter's action
	                    cmp              arrowoffsetY, arrowAtExit
	                    je               exitProg
	                    cmp              arrowoffsetY, arrowAtChat
	;je gameLoop
	                    cmp              arrowoffsetY, arrowAtgame
	                    je               gameLoop
	                    jmp              CheckInMainMenu
	;///////////////////////////////Game Loop////////////////////////////////////
	gameLoop:                                                     	;NOTE:since we are using words, we will use the value '2' to traverse pixels
	;//////////////////////////////initializations////////////////////////////////////
	                    mov              ax, graphicsMode
	                    mov              bx, 0100h
	                    int              10h
	                    call             Drawship                 	;this subroutine is responsible for drawing the ship using its cooardinates
	;////////////////////////////Interacting with the user////////////////////////////
	CHECK:              mov              ah,1
	                    int              16h
	                    jz               CHECK                    	; check if there is any input
	                    CALL             GENERATE_OFFSET          	; TO GENERATE THE new OFFSET OF THE ship
	;/////////////////////////////////////////////////////////////////////////////////
	                    jmp              gameLoop
	;///////////////////////////////Exit Program/////////////////////////////////////
	exitProg:           
	                    clearWholeScreen
	                    mov              ah,09h
	                    lea              dx, byebye               	; show the bye bye screen
	                    int              21h

	                    mov              ah,4ch
	                    int              21h
MAIN ENDP
	;//////////////////////////////Procedures//////////////////////////////////////////////
GENERATE_OFFSET PROC near

	                    cmp              al,1Bh                   	; ESC
	                    jz               exitProg
	                    call             Eraseship                	; get the pressed key from the user
	                    MOVEMENT         11H, 1FH, 1EH, 20H


	ReadKey:            
	                    call             Drawship

	                    mov              ah,0                     	;wait for a key to be pressed and put it in ah, ah:al = scan code: ASCII code
	                    int              16h

	                    mov              cx, 0                    	; initialize cx to use it to iterate over the shipSize
	                    jmp              CHECK
	;///////////////////////////////////////////////////////////////////////////////////////
	MoveUp:             
	;checking for boundaries
	;moveUP
	                    mov              bx, offsetY
	                    cmp              bx, minY
	                    jna              ReadKey
	                    sub              bx, planeSpeed
	                    mov              DI, offset offsetY
	                    mov              [DI], bx

	                    jmp              ReadKey

	MoveDown:           
	;checking for boundaries
	;MoveDown
	                    mov              bx, offsetY
	                    mov              cx, bx
	                    add              cx, sizeY
	                    cmp              cx, maxY
	                    jnb              ReadKey
	                    add              bx,planeSpeed
	                    mov              DI, offset offsetY
	                    mov              [DI], bx

	                    jmp              ReadKey

	MoveLeft:           
	;checking for boundaries
	                    mov              bx, offsetX
	                    cmp              bx, minX
	                    jna              ReadKey
	                    sub              bx, planeSpeed
	                    mov              DI, offset offsetX
	                    mov              [DI], bx
	          
	                    jmp              ReadKey

	MoveRight:          
	;checking for boundaries
	                    mov              bx, offsetX
	                    mov              cx, bx
	                    add              cx, sizeX
	                    cmp              cx, maxX
	                    jnb              ReadKey
	                    add              bx, planeSpeed
	                    mov              DI, offset offsetX
	                    mov              [DI], bx

	                    jmp              ReadKey
	                    ret

GENERATE_OFFSET ENDP
Drawship PROC	near
	; initialize containers
	                    mov              SI, offset shipC
	                    mov              cx, SizeX                	;Column X
	                    mov              dx, SizeY                	;Row Y
	                    mov              ah, 0ch                  	;Draw Pixel Command
	Drawit:             
	                    mov              bl, [SI]                 	;use color from array color for testing
	                    and              bl, bl
	                    JZ               back
	                    add              cx, offsetX
	                    add              dx, offsety
	                    mov              al, [SI]                 	;  use color from array color for testing
	                    int              10h                      	;  draw the pixel
	                    sub              cx, offsetX
	                    sub              dx, offsety

	back:               
	                    inc              SI
	                    DEC              Cx                       	;  loop iteration in x direction
	                    JNZ              Drawit                   	;  check if we can draw c urrent x and y and excape the y iteration
	                    mov              Cx, SizeX                	;  if loop iteration in y direction, then x should start over so that we sweep the grid
	                    DEC              DX                       	;  loop iteration in y direction
	                    JZ               alldrawn                 	;  both x and y reached 00 so finish drawing
	                    jmp              Drawit
	alldrawn:           ret
Drawship ENDP
