drawArrows PROC near
	; initialize containers
	                    mov              SI, offset arrow
	                    mov              cx, arrowSizeX           	;Column X
	                    mov              dx, arrowSizeY           	;Row Y
	                    mov              ah, 0ch                  	;Draw Pixel Command
	DrawitArrow:        
