	                    jmp              DrawitArrow
	alldrawnArrow:      
	;///////////////////////////////
	; initialize containers
	                    mov              SI, offset arrow
	                    mov              cx, 0                    	;Column X
	                    mov              dx, arrowSizeY           	;Row Y
	                    mov              ah, 0ch                  	;Draw Pixel Command
	DrawitR:            
